# Different colour values & technical values:
.eqv BASE_ADDRESS 0x10008000
.eqv WIDTH 64
.eqv REFRESH_RATE 40
.eqv PIXEL_COUNT 16380
.eqv COLLISION_TIMER 300

# Colour
.eqv SKY_COLOUR 0x000015
.eqv OBST_COLOUR 0x696A6B
.eqv PLAYER_COLOUR 0x00ff00
