.eqv LOST_HEALTH 0xff0000
.eqv TEXT_COLOUR 0xEBA434
.eqv WHITE 0xffffff
.eqv REMAINING_HEALTH 0x00ff00

# Difficulty increasing values:

# The rate at which the asteroids will go across the screen (lower is faster, minimum being 0)
.eqv OBST_SPEED 20

# Number of obstacles (up to 10)
.eqv OBST_NUM 5

# Initial health points (up to 10)
.eqv HP 10


.data
