# Player struct has 3 values: x, y, position (on the bitmap)
PLAYER: .word 0:18 # 3 * 6 (6 pixels are the player)

# The reason for the high allocation is being able to have up to 15 obstacles at once (x,y, position * 15)
OBST: .word 0:150 # 3 * 5 (5 pixels are the obstacles) * 10 (max obstacles)

# Health Array
