# Level & Score values
GAME_INFO: .word 0:5 # Level, Speed, Number of Asteroids, Level Progress (0-10), Total Score

.text
	li $s0, BASE_ADDRESS # Stores the base address for display
	la $s1, PLAYER # Address of array PLAYER
	la $s2, OBST # Address of obstacles
	la $s3, HEALTH # Address of HP bar
	li $s4, HP # Current HP
	la $s5, GAME_INFO # Array that has the current game's info (level, score, etc)
	
	move $t0, $s0 # Copy for offsetting
	li $t1, 0 # Initial Counter
	li $t2, PIXEL_COUNT # Number to stop at
	la $t3, STARTUP_IMAGE # Startup image RGB values
	
	jal draw_opening_image
	
	li $v0, 32
	li $a0, 3000 # Wait 2s
	syscall
	
	jal initial_game_state
	jal key_wait
	
draw_opening_image:
	bgt $t1, $t2, return
	lw $t4, 0($t3)
	sw $t4, 0($t0)
	addi $t0, $t0, 4
	addi $t1, $t1, 4
	addi $t3, $t3, 4
	j draw_opening_image	

	
		

	
	
# This draws how the game looks like at the start
initial_game_state: 
	# Initial Game Info for level management

	li $t1, 1 # Default Level
	sw $t1, 0($s5) 
	li $t1, OBST_SPEED # Initial Obstacle speed
	sw $t1, 4($s5) 
	li $t1, OBST_NUM # Initial number of obstacles
	sw $t1, 8($s5)
	li $t1, 0 # Default level progress
	sw $t1, 12($s5)
	sw $t1, 16($s5) # Default score 
	

	move $t0, $s0 # Copy for offsetting
	li $t1, 0 # Initial Counter
	li $t2, PIXEL_COUNT # Number to stop at
	li $t3, SKY_COLOUR # Sky colour
	li $s4, HP # Reset HP

draw_background:
	bgt $t1, $t2, draw_hud # Setting the colour of the background to be SKY_COLOUR
	sw $t3, 0($t0)
	addi $t0, $t0, 4
	addi $t1, $t1, 4
	j draw_background

draw_hud:
	move $t0, $s0 # Copy for offsetting
	li $t9, TEXT_COLOUR
	li $t8, WHITE
	
	# HP Text
