	sw $ra, 0($sp)
	jal draw_one
	lw $ra, 0($sp)
	addi $sp, $sp, 4
	
	# Drawing HP Bar
	move $t0, $s0
	li $t8, REMAINING_HEALTH
	move $t1, $s3 # HP Array for offsetting
	addi $t2, $zero, 4 # How many bytes is in one HP (1 Pixel * 4 bytes)
	move $t3, $s4 # Number of initial HP
	li $t9, WHITE
	mult $t2, $t3
	mflo $t2 # Bytes * Number of HP 
	addi $t3, $zero, 0 # Initial Counter
	
	sw $t9, 14656($t0)
	sw $t9, 14912($t0)
	sw $t9, 15168($t0)
	sw $t9, 15424($t0)
	sw $t9, 15680($t0)
	sw $t9, 15936($t0)
	
	addi $t0, $t0, 14660 # First part of the HP
	
hp_drawing_loop:
	bge $t3, $t2, end_hp_loop
	
	# Drawing Borders
	# Top
	sw $t9, 0($t0)
	# Bottom
	sw $t9, 1280($t0)
	
	addi $t0, $t0, 256 # Down one pixel
	sw $t8, 0($t0)
	sw $t0, 0($t1) # Top pixel stored in HP array
	addi $t0, $t0, 256 # Down one more pixel
	sw $t8, 0($t0) 
	addi $t0, $t0, 256 # Down one more pixel
	sw $t8, 0($t0) 
	addi $t0, $t0, 256 # Down one more pixel
	sw $t8, 0($t0) 
	addi $t0, $t0, -1024 # Reset offset
	
	addi $t3, $t3, 4 # Increment
	addi $t0, $t0, 4 # Move base address 1 pixel to the right
	addi $t1, $t1, 4 # Move HP one index to the right
	
	j hp_drawing_loop



end_hp_loop:
	# Right outline
	sw $t9, 0($t0)
	sw $t9, 256($t0)
	sw $t9, 512($t0)
	sw $t9, 768($t0)
	sw $t9, 1024($t0)
	sw $t9, 1280($t0)
	j draw_player
	
# How the player will look (each "-" is a pixel)	
#  --
#   --
#  --
# Address in the array
#  23
#   01
#  45
draw_player:
	move $t0, $s0 # $t0 = BASE_ADDRESS
	addi $t1, $zero, 3 # x value (Hard-coded to be 3 because in games they spawn on the left side)
	addi $t9, $zero, PLAYER_COLOUR # Stores the player colour in $t9
	li $v0, 42 # Random y-value for the player (y = 5 to 45)
	li $a0, 0
	li $a1, 35
	syscall
	addi $a0, $a0, 5 # Taking in account for offset (0->5)
	move $t2, $a0 # y value (random)
	
	move $a0, $t1 # Putting x into argument 0
	move $a1, $t2 # Putting y into argument 1
	addi $sp, $sp -4 # Putting current $ra on stack
	sw $ra, 0($sp)
	jal calculate_offset # Calculate the pixel offset
	lw $ra, 0($sp) # Get the current $ra back
	addi $sp, $sp, 4
	
	# Setting values for Player
	
	# Player[0]
	add $t0, $t0, $v1 # Current base address is the center of the player
	sw $t1, 0($s1) # x value to Player[0]
	sw $t2, 4($s1) # y value to Player[0]
	sw $t0, 8($s1) # Stores the location of the pixel to Player[0]
	sw $t9, 0($t0) # Makes the pixel PLAYER_COLOUR
	#sub $t0, $t0, $v0 
	
	
	# Player[1]
	addi $t0, $t0, 4 # Offset from center
	addi $t1, $t1, 1 # Offset of x
	
	sw $t1, 12($s1) # x+1 value to Player[1]
	sw $t2, 16($s1) # y value to Player[1]
	sw $t0, 20($s1) # Stores the location of the pixel to Player[0]
	sw $t9, 0($t0) # Makes the pixel PLAYER_COLOUR
	
	# Resetting offsets
	addi $t0, $t0, -4
	addi $t1, $t1, -1
	
	
	# Player[2]
	addi $t0, $t0, -260 # Pixel offset from center
	addi $t1, $t1, -1 # Offset of x
	addi $t2, $t2, -1 # Offset of y
	
	sw $t1, 24($s1) # x-1 value to Player[2]
	sw $t2, 28($s1) # y-1 value to Player[2]
	sw $t0, 32($s1) # Stores the location of the pixel to Player[0]
	sw $t9, 0($t0) # Makes the pixel PLAYER_COLOUR
	
	# Resetting offsets
	addi $t0, $t0, 260 
	addi $t1, $t1, 1
	addi $t2, $t2, 1
	
	# Player[3]
	addi $t0, $t0, -256 # Pixel offset from center
	addi $t2, $t2, -1 # Offset of y
	
	sw $t1, 36($s1) # x value to Player[3]
	sw $t2, 40($s1) # y-1 value to Player[3]
	sw $t0, 44($s1) # Stores the location of the pixel to Player[0]
	sw $t9, 0($t0) # Makes the pixel PLAYER_COLOUR
	
	# Resetting offsets
	addi $t0, $t0, 256
	addi $t2, $t2, 1
	
	
	# Player[4]
	addi $t0, $t0, 252 # Pixel offset from center
	addi $t1, $t1, -1 # Offset of x
	addi $t2, $t2, 1 # Offset of y
	
	sw $t1, 48($s1) # x-1 value to Player[4]
	sw $t2, 52($s1) # y+1 value to Player[4]
	sw $t0, 56($s1) # Stores the location of the pixel to Player[0]
	sw $t9, 0($t0) # Makes the pixel PLAYER_COLOUR
	
	# Resetting Offsets
	addi $t0, $t0, -252
	addi $t1, $t1, 1
	addi $t2, $t2, -1
	
	
	# Player[5]
	addi $t0, $t0, 256 # Pixel offset from center
	addi $t1, $t1, 1 # Offset of x
	addi $t2, $t2, 1 # Offset of y
	
	sw $t1, 60($s1) # x+1 value to Player[5]
	sw $t2, 64($s1) # y+1 value to Player[5]
	sw $t0, 68($s1) # Stores the location of the pixel to Player[0]
	sw $t9, 0($t0) # Makes the pixel PLAYER_COLOUR
	
	# Resetting offsets
	addi $t0, $t0, -256
	addi $t1, $t1, -1
	addi $t2, $t2, -1
	
	
	move $a2, $s2
	lw $a3, 8($s5) # Initial obstacle number
	j draw_obstacles
	
# How the obstacle will look like (each "-" is a pixel)
#   -
#  ---
#   -
# Address in the array
#   3
#  102
#   4

draw_obstacles:	
	# a2 - Array(s) to draw
	# a3 - Number of objects to draw
	addi $t0, $zero, 60 # How many bytes are in one obstacle array (4 * 15)
	move $t1, $a3
	mult $t0, $t1 # Storing the size of the array for the amount of obstacles to draw
	mflo $t1
	addi $t0, $zero, 0 # Initial Counter
	move $t2, $a2 # Array of the obstacle
	addi $t8, $zero, OBST_COLOUR
obst_loop:
	bge $t0, $t1, return
	
	# Random x value
	li $v0, 42 # Obstacle x value should be somewhere on the right side
	li $a0, 0
	li $a1, 3 # Choose from x = 0-3
	syscall
	addi $a0, $a0, 60 # Take in account for the offset 
	move $t3, $a0 # x value (random)
	
	# Random y value
	li $v0, 42 # Choosing a random spot in the middle for the obstacle to be, this will be the y value
	li $a0, 0
	li $a1, 54
	syscall
	addi $a0, $a0, 1 # Take in account for the offset 
	move $t4, $a0 # y value (random)
	
	move $t5, $s0 # Make $t5 BASE_ADDRESS
	# Note: Make obstacle colour a bit random later
	addi $t9, $zero, OBST_COLOUR # Store the obstacle colour in $t9
	
	
	move $a0, $t3 # $a0 = x
	move $a1, $t4 # $a1 = y
	addi $sp, $sp -4 # Putting current $ra on stack
	sw $ra, 0($sp)
	jal calculate_offset # Calculate the pixel offset
	lw $ra, 0($sp) # Get the current $ra back
	addi $sp, $sp, 4
	
	
	# Setting values for the obstacle
	
	# Obstacle[0]
	add $t5, $t5, $v1 # Pixel Offset from center
	sw $t3, 0($t2) # x value to Obstacle[0]
	sw $t4, 4($t2) # y value to Obstacle[0]
	sw $t5, 8($t2) # Stores the location of the pixel to Obstacle[0]
	sw $t8, 0($t5) # Makes the pixel OBST_COLOUR
	
	# Obstacle[1]
	addi $t5, $t5, -4 # Pixel Offset from center
	addi $t3, $t3, -1 # Offset of x
	
	sw $t3, 12($t2) # x value to Obstacle[0]
	sw $t4, 16($t2) # y value to Obstacle[0]
	sw $t5, 20($t2) # Stores the location of the pixel to Obstacle[0]
	sw $t8, 0($t5) # Makes the pixel OBST_COLOUR
	
	# Resetting offset
	addi $t5, $t5, 4
	addi $t3, $t3, 1
	
	
	
	# Obstacle[2]
	addi $t5, $t5, 4 # Pixel Offset from center
	addi $t3, $t3, 1 # Offset of x
	
	sw $t3, 24($t2) # x value to Obstacle[0]
	sw $t4, 28($t2) # y value to Obstacle[0]
	sw $t5, 32($t2) # Stores the location of the pixel to Obstacle[0]
	sw $t8, 0($t5) # Makes the pixel OBST_COLOUR
	
	# Resetting offset
	addi $t5, $t5, -4
	addi $t3, $t3, -1
	
	
	# Obstacle[3]
	addi $t5, $t5, -256 # Pixel Offset from center
	addi $t4, $t4, -1 # Offset of y
	
	sw $t3, 36($t2) # x value to Obstacle[0]
	sw $t4, 40($t2) # y value to Obstacle[0]
	sw $t5, 44($t2) # Stores the location of the pixel to Obstacle[0]
	sw $t8, 0($t5) # Makes the pixel OBST_COLOUR
	
	# Resetting offset
	addi $t5, $t5, 256
	addi $t4, $t4, 1
	
	
	# Obstacle[4]
	addi $t5, $t5, 256 # Pixel Offset from center
	addi $t4, $t4, 1 # Offset of y
	
	sw $t3, 48($t2) # x value to Obstacle[0]
	sw $t4, 52($t2) # y value to Obstacle[0]
	sw $t5, 56($t2) # Stores the location of the pixel to Obstacle[0]
	sw $t8, 0($t5) # Makes the pixel OBST_COLOUR
	
	# Resetting offset
	addi $t5, $t5, -256
	addi $t4, $t4, -1
	
	addi $t0, $t0, 60 # Increment to next obstacle
	addi $t2, $t2, 60
	j obst_loop
	

