# Keyboard Functions

key_wait: # Waiting for a keyboard input repeatedly, as well as making the game progress
	beqz $s4, game_over # If player has no lives, game over
	
	jal move_obstacles # Move obstacles
	li $t9, 0xffff0000
	lw $t8, 0($t9)
	beq $t8, 1, key_pressed # Key was pressed
	
	li $v0, 32
	li $a0, REFRESH_RATE # Refresh rate sleep timer
	syscall
	
	j key_wait # Wait for key again

key_pressed: # A key was pressed, check what key was pressed 
	li $v0, 32
	li $a0, REFRESH_RATE # Wait 40ms
	syscall

	lw $t7, 4($t9)
	beq $t7, 0x77, w_pressed
	beq $t7, 0x61, a_pressed
	beq $t7, 0x73, s_pressed
	beq $t7, 0x64, d_pressed
	beq $t7, 0x70, p_pressed
	j key_wait

w_pressed: 
	# Check if Player[3]'s y value is 0, if it is, return
	lw $t0, 40($s1)
	beqz $t0, key_wait
	# Move player up
	li $a0, -256
	li $a1, 0
	j move_player

a_pressed:
	# Check if Player[2]'s x value is 0, if it is, return
	lw $t0, 24($s1)
	beqz $t0, key_wait
	# Move player left
	li $a0, -4
	li $a1, 1
	j move_player

s_pressed:
	# Check if Player[5]'s y value is 54, if it is, return
	lw $t0, 64($s1)
	beq $t0, 54, key_wait
	# Move player down
	li $a0, 256
	li $a1, 2
	j move_player

d_pressed:
	# Check if Player[1]'s x value is 63, if it is, return
	lw $t0, 12($s1)
	beq $t0, 63, key_wait
	# Move player right
	li $a0, 4
	li $a1, 3
	j move_player

p_pressed: 
	# Reset game to how it was in the beginning
	j initial_game_state
	
	
		
# $a0 = offset to move each pixel
# $a1 = Direction (W = 0, A = 1, S = 2, D = 2)
# 	 -256
#	   ^
#    -4 <--|--> 4
#          v
#	  256
move_player:
	li $t1, 0 # Initial Value
	li $t2, 72 # Number of bytes in player
	move $t3, $s1 # Player array for offseting
	li $t8, SKY_COLOUR
	li $t9, PLAYER_COLOUR
	#li $t8, BOSS_COLOUR
move_player_loop:
	bge $t1, $t2, player_moved
	add $t3, $s1, $t1
	
	lw $t4, 8($t3) # Load the current pixel location
	sw $t8, 0($t4)
	sw $t8, 0($t4) # Make the current pixel location SKY_COLOUR
	add $t4, $t4, $a0 # Shift it by $a0
	sw $t4, 8($t3) # Put new pixel address
	
	beq $a1, 0, shift_up
	beq $a1, 1, shift_left
	beq $a1, 2, shift_down
	j shift_right
	
player_moved:
	addi $sp, $sp -4 # Putting current $ra on stack
	sw $ra, 0($sp)
	jal redraw_player # Calculate the pixel offset
	lw $ra, 0($sp) # Get the current $ra back
	addi $sp, $sp, 4
	j key_wait
		
	

shift_up: # x, y-1
	lw $t4, 4($t3) # y value
	addi $t4, $t4, -1
	sw $t4, 4($t3)
	j player_increment
	

shift_left: # x-1, y
	lw $t4, 0($t3) # x value
	addi $t4, $t4, -1
	sw $t4, 0($t3)
	j player_increment

shift_down: # x,y+1
	lw $t4, 4($t3) # y value
	addi $t4, $t4, 1
	sw $t4, 4($t3)
	j player_increment

shift_right: # x+1, y
	lw $t4, 0($t3) # x value
	addi $t4, $t4, 1
	sw $t4, 0($t3)
	j player_increment
	
player_increment:
	addi $t1, $t1, 12
	j move_player_loop
	
	
redraw_player:
	li $t1, 0 # Initial Value
	li $t2, 72 # Number of bytes in player
	move $t3, $s1 # Player array for offseting
	li $t9, PLAYER_COLOUR
redraw_player_loop:
	bge $t1, $t2, return
	add $t3, $s1, $t1
	lw $t4, 8($t3) # Load the current pixel location
	sw $t9, 0($t4)
	addi $t1, $t1, 12
	j redraw_player_loop

move_obstacles:
	move $t0, $s2 # Array of obstacles 
	addi $t1, $zero, 60 # How many bytes are in one obstacle array (4 * 15)
	lw $t2, 8($s5) # How many obstacles there are currently
	mult $t1, $t2
	mflo $t2
	addi $t1, $zero, 0
	
move_obs_loop: # 1 0 2 3 4 (x - 1), the order in which to move the pixels (old algo but still works good)
	bge $t1, $t2, return
	
	# Check if any of the four corners of the obstacle is touching any piece of the player
	# Put current $ra in stack
	addi $sp, $sp -4
	sw $ra, 0($sp)
	jal check_collision # If there is a collision, $v1 will be 1
	li $t8, 1
	lw $ra, 0($sp)
	addi $sp, $sp, 4
	
	
	addi $t8, $zero, SKY_COLOUR
	addi $t9, $zero, OBST_COLOUR
	beqz $v1, redraw_obst
		
	
	# Check if left part is at x = 0
	lw $t3, 12($t0)
	# If it's zero, then increase the "level progress"
	beqz $t3, increase_score
	
	
	lw $t3, 4($s5)
	
	li $v0, 32
	move $a0, $t3
	syscall
	
	lw $t3, 20($t0)
	sw $t8, 0($t3)
	addi $t3, $t3, -4
	sw $t9, 0($t3)
	sw $t3, 20($t0)
	lw $t3, 12($t0) # x value
	addi $t3, $t3, -1
	sw $t3, 12($t0)
	
	
	lw $t3, 8($t0)
	sw $t8, 0($t3)
	addi $t3, $t3, -4
	sw $t9, 0($t3)
	sw $t3, 8($t0)
	lw $t3, 0($t0) # x value
	addi $t3, $t3, -1
	sw $t3, 0($t0)
	
	lw $t3, 32($t0)
	sw $t8, 0($t3)
	addi $t3, $t3, -4
	sw $t9, 0($t3)
	sw $t3, 32($t0)
	lw $t3, 24($t0) # x value
	addi $t3, $t3, -1
	sw $t3, 24($t0)
	
	lw $t3, 44($t0)
	sw $t8, 0($t3)
	addi $t3, $t3, -4
	sw $t9, 0($t3)
	sw $t3, 44($t0)
	lw $t3, 36($t0) # x value
	addi $t3, $t3, -1
	sw $t3, 36($t0)
	
	lw $t3, 56($t0)
	sw $t8, 0($t3)
	addi $t3, $t3, -4
	sw $t9, 0($t3)
	sw $t3, 56($t0)
	lw $t3, 48($t0) # x value
	addi $t3, $t3, -1
	sw $t3, 48($t0)
	
	
	addi $t1, $t1, 60
	addi $t0, $t0, 60
	j move_obs_loop


redraw_obst:
	# Something happened to make the obstacle be redrawn (collision or hit the left edge)

	addi $t8, $zero, SKY_COLOUR

	# Put current $ra in stack
	addi $sp, $sp -4
	sw $ra, 0($sp)
	li $v1, 1
	
	
	lw $t3, 20($t0)
	sw $t8, 0($t3)
	
	lw $t3, 8($t0)
	sw $t8, 0($t3)
	
	lw $t3, 32($t0)
	sw $t8, 0($t3)
	
	lw $t3, 44($t0)
	sw $t8, 0($t3)
	
	lw $t3, 56($t0)
	sw $t8, 0($t3)
	
	# Redraw player
	addi $sp, $sp -4 # Putting current $ra on stack
	sw $ra, 0($sp)
	jal redraw_player # Redraw the player due to collision
	lw $ra, 0($sp) # Get the current $ra back
	addi $sp, $sp, 4
	
	# Redraw 1 obstacle
	move $a2, $t0
	addi $a3, $zero, 1
	jal draw_obstacles
	lw $ra, 0($sp)
	addi $sp, $sp, 4
	jr $ra
	
	
	
	
# Level functions

increase_score:
	lw $t4, 16($s5) # Current Score
	beq $t4, 999, redraw_obst # 999 is max score
	addi $t4, $t4, 1
	sw $t4, 16($s5) # Add one to the score

	lw $t4, 12($s5) # Level progress (0-10)
	addi $t4, $t4, 1 # Add by 1
	
	sw $t4, 12($s5)
	beq $t4, 10, next_level
	j redraw_obst



next_level:
	addi $t4, $zero, 0
	sw $t4, 12($s5) # Progress to next level has been reset
	lw $t4, 0($s5) # Current level
	beq $t4, 11, redraw_obst # Level 11 (EX) is the max
	addi $t4, $t4, 1 # Increase level by 1
	sw $t4, 0($s5) # New Level
	li $a1, 14776 # Offset for level numbers
	
	# Level number drawing
	beq $t4, 2, level_two_up
	beq $t4, 3, level_three_up
	beq $t4, 4, level_four_up
	beq $t4, 5, level_five_up
	beq $t4, 6, level_six_up
	beq $t4, 7, level_seven_up
	beq $t4, 8, level_eight_up
	beq $t4, 9, level_nine_up
	beq $t4, 10, level_ten_up
	beq $t4, 11, level_ex_up


level_changed:	
	# To increase asteroids, level % 2 == 1
	li $t5, 2
	div $t4, $t5
	mfhi $t4 # Remainder
	beq $t4, 1, add_obstacle # One obstacle added every odd level (excluding level 1)

	
change_speed:
	lw $t4, 4($s5) # Current speed
	addi $t4, $t4, -2 # Decrease speed by 2 (Actually increasing it)
	sw $t4, 4($s5) # New speed
	

	
	j redraw_obst

add_obstacle: # Use $t4, $t5
	# Go to the last obstacle, and draw it (offset would be (obstacle_num - 1) * 60
	lw $t4, 8($s5) # Number of obstacles
	addi $t4, $t4, 1
	sw $t4, 8($s5) # New number of obstacles
	
	addi $t4, $t4, -1 
	li $t5, 60
	mult $t4, $t5
	mflo $t4 # $t4 has the correct offset of the new obstacle
	add $t5, $s2, $t4 # Offset in the array for the last obstacle
	
	# Put current $ra in stack
	addi $sp, $sp, -4
	sw $ra, 0($sp)
	
	# Put $t0 and $t1 in stack to keep value for later
	addi $sp, $sp, -4
	sw $t0, 0($sp)
	addi $sp, $sp, -4
	sw $t1, 0($sp)
	
	# Draw one obstacle from the last offset
	move $a2, $t5
	addi $a3, $zero, 1
	
	jal draw_obstacles
	
	# Get old values back
	lw $t1, 0($sp)
	addi $sp, $sp, 4
	
	lw $t0, 0($sp)
	addi $sp, $sp, 4
	
	lw $ra, 0($sp)
	addi $sp, $sp, 4
	
	j change_speed
	
