# Calculating functions

# $a0 = x
# $a1 = y
# Will return v1 = address(x,y) = (y*width + x) *4
calculate_offset: 
	li $a2, WIDTH
	mult $a1, $a2
	mflo $a1
	add $a0, $a0, $a1
	li $a1, 4
	mult $a0, $a1
	mflo $v1 # Offset for a point on the graph (x,y)
	jr $ra
	
# Checking collision using manhattan distance formula |x1-x2| + |y1-y2|
check_collision: #t3 - t9
	move $a0, $t0
	move $a1, $s1
	li $t3, -1 # For absolute and multiplying
	lw $t4, 0($a0) # x value of obstacle
	lw $t5, 0($a1) # x value of player
	sub $t4, $t4, $t5
	ble $t4, $t3, absolute_x # Convert to absolute if not
x_true:
	lw $t5, 4($a0) # y value of obstacle
	lw $t6, 4($a1) # y value of player
	sub $t5, $t5, $t6 
	ble $t5, $t3, absolute_y
y_true:
	add $t4, $t4, $t5 # Distance
	li $t3, 2
	ble $t4, $t3, collided
	li $v1, 1
	jr $ra

absolute_x:
	lw $t4, 0($a0) # x value of obstacle
	sub $t4, $t5, $t4
	j x_true
	
absolute_y:
	lw $t5, 4($a0) # y value of obstacle
	sub $t5, $t6, $t5
	j y_true

	
collided:
	# Change the player colour for a second
	li $t9, PLAYER_COLOUR
	li $t8, COLLISION_COLOUR
	
	# Turning the players into COLLISION_COLOUR, then changing back
	lw $t3, 8($a1)
	sw $t8, 0($t3)
	
	lw $t3, 20($a1)
	sw $t8, 0($t3)
	
	lw $t3, 32($a1)
	sw $t8, 0($t3)
	
	lw $t3, 44($a1)
	sw $t8, 0($t3)
	
	lw $t3, 56($a1)
	sw $t8, 0($t3)
	
	lw $t3, 68($a1)
	sw $t8, 0($t3)
	
	li $v0, 32
	li $a0, COLLISION_TIMER # Wait
	syscall
	
	lw $t3, 8($a1)
	sw $t9, 0($t3)
	
	lw $t3, 20($a1)
	sw $t9, 0($t3)
	
	lw $t3, 32($a1)
	sw $t9, 0($t3)
	
	lw $t3, 44($a1)
	sw $t9, 0($t3)
	
	lw $t3, 56($a1)
	sw $t9, 0($t3)
	
	lw $t3, 68($a1)
	sw $t9, 0($t3)
	
	# Make the last HP box red
	move $t3, $s4 # Current HP left
	addi $t3, $t3, -1 # Index is from 0 to [Health - 1]
	li $t4, 4
	mult $t3, $t4
	mflo $t3 # Offset for the last health
	move $t4, $s3 # HP Array
	add $t4, $t4, $t3 # Last health bar
	li $t5, LOST_HEALTH
	lw $t6, 0($t4)
	sw $t5, 0($t6)
	sw $t5, 256($t6)
	sw $t5, 512($t6)
	sw $t5, 768($t6)
	addi $s4, $s4, -1
	
	li $v1, 0
	jr $ra

game_over:
# Starts drawing the title graphic

	move $t0, $s0 # Copy for offsetting
	li $t1, 0 # Initial Counter
	li $t2, PIXEL_COUNT # Number to stop at
	la $t3, GAMEOVER_IMAGE # Startup image RGB values
	
game_over_loop:
	
	bgt $t1, $t2, game_over_score
	lw $t4, 0($t3)
	sw $t4, 0($t0)
	addi $t0, $t0, 4
	addi $t1, $t1, 4
	addi $t3, $t3, 4
	j game_over_loop


return:
	jr $ra

	
game_over_score:
	lw $t1, 16($s5) # Current Score
	li $t2, 10 # Divide by 10 each time for each digit
	div $t1, $t2
	mflo $t1 # Quotient
	mfhi $t3 # Remainder, number to print	


	addi $sp, $sp -4
	sw $ra, 0($sp)
	jal score_ones
	lw $ra, 0($sp)
	addi $sp, $sp, 4
	
	div $t1, $t2
	mflo $t1 # Quotient
	mfhi $t3 # Remainder, number to print
	
	addi $sp, $sp -4
	sw $ra, 0($sp)
	jal score_tens
	lw $ra, 0($sp)
	addi $sp, $sp, 4
	
	div $t1, $t2
	mflo $t1 # Quotient
	mfhi $t3 # Remainder, number to print
	
	addi $sp, $sp -4
	sw $ra, 0($sp)
	jal score_hundreds
	lw $ra, 0($sp)
	addi $sp, $sp, 4


	j wait_for_restart

# Printing the different numbers in the score
score_ones:
	li $a1, 14044 # Ones Digit offset

	beq $t3, 0, draw_zero
	beq $t3, 1, draw_one
	beq $t3, 2, draw_two
	beq $t3, 3, draw_three
	beq $t3, 4, draw_four
	beq $t3, 5, draw_five
	beq $t3, 6, draw_six
	beq $t3, 7, draw_seven
	beq $t3, 8, draw_eight
	beq $t3, 9, draw_nine	

score_tens:
	li $a1, 14008 # Tens digit offset
	
	beq $t3, 0, draw_zero
	beq $t3, 1, draw_one
	beq $t3, 2, draw_two
	beq $t3, 3, draw_three
	beq $t3, 4, draw_four
	beq $t3, 5, draw_five
	beq $t3, 6, draw_six
	beq $t3, 7, draw_seven
	beq $t3, 8, draw_eight
	beq $t3, 9, draw_nine	

score_hundreds:
	li $a1, 13972 # Hundreds digit offset 
	
	beq $t3, 0, draw_zero
	beq $t3, 1, draw_one
	beq $t3, 2, draw_two
	beq $t3, 3, draw_three
	beq $t3, 4, draw_four
	beq $t3, 5, draw_five
	beq $t3, 6, draw_six
	beq $t3, 7, draw_seven
	beq $t3, 8, draw_eight
	beq $t3, 9, draw_nine	
	

# Similar to key_wait, except its only for one key: p
wait_for_restart:
	li $t9, 0xffff0000
	lw $t8, 0($t9)
	beq $t8, 1, restart_key
	j wait_for_restart

restart_key:
	lw $t7, 4($t9)
	beq $t7, 0x70, p_pressed
	j wait_for_restart
	

	
	
	
	
	
	


	
